Vue.component('modal-hello', {
    template: '#templ-modal-hello',
    inject: ['modal'],
});

new Vue({
    el: '#app',
    methods: {
        hello: async function () {
            console.log(await modal_hello().promise());
        },
    },
});

function modal_hello(value)
{
    return vue_modal({template: '<modal-hello v-model="value" />', data: {value}});
}
